import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import DarkLightTheme from "./contexts/DarkLightContext";
import LanguageTuru from "./contexts/LanguageContext";

import "./reset.css";

ReactDOM.render(
  <React.StrictMode>
    <DarkLightTheme>
      <LanguageTuru>
        <App />
      </LanguageTuru>
    </DarkLightTheme>
  </React.StrictMode>,
  document.getElementById("root")
);
